pragma solidity ^0.8.0;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract PaymentProcessor {
  address public admin;
  IERC20 public usdc;

  event PaymentDone(
    address payer,
    uint amount,
    string paymentId,
    uint date
  );

  constructor(address adminAddress, address usdcAddress) public {
    admin = adminAddress;
    usdc = IERC20(usdcAddress);   
  }

  function pay(uint amount, string calldata paymentId) external {
    usdc.transferFrom(msg.sender, admin, amount);
    emit PaymentDone(msg.sender, amount, paymentId, block.timestamp);
  }
}
